          <input 
          {...register('description')}
          type='text'
          name='description'
          className="base-input" />
          <div className="form-container-buttons">
            <button>SALVAR</button>
            <button>CANCELAR</button>
          </div>
        </div>

        <PermissionTable />
      </form>
    </div>
  );
};

export default Permission;
